"use strict";

$(document).ready(function () {
  //BEGIN ACCORDION
  $(".accordion__title").on("click", function (e) {
    e.preventDefault();
    var $this = $(this);
    if (!$this.hasClass("accordion-active")) {
      $(".accordion__content").slideUp(400);
      $(".accordion__title").removeClass("accordion-active");
      $this.prev().addClass("rotate");
      $('.acc__bg02').not($this.prev()).removeClass("rotate");
    } else {
      $this.prev("").removeClass("rotate");
    }
    $this.toggleClass("accordion-active");
    $this.next().slideToggle();
  });
  //END ACCORDION

  // swiper
  var swiper = new Swiper(".mySwiper", {
    slidesPerView: 2,
    spaceBetween: 20,
    loop: true,
    keyboard: {
      enabled: true
    },
    autoplay: {
      delay: 1500,
      disableOnInteraction: false
    },
    pagination: {
      el: ".swiper-pagination",
      clickable: true
    },
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev"
    },
    breakpoints: {
      320: {
        slidesPerView: 1
      },
      650: {
        slidesPerView: 2,
        spaceBetween: 10
      }
    }
  });

  // mainNewsSwiper 

  var swiperNews = new Swiper(".main__news__swiper", {
    loop: true,
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev"
    }
  });

  // imusk
  var phoneInput = document.querySelector(".footer__feedback-tel");
  var phoneMask = new IMask(phoneInput, {
    mask: "+{7} (000) 000-00-00"
  });

  // dropdown 

  function show(value) {
    document.querySelector(".text-box").value = value;
  }
  var dropdown = document.querySelector(".dropdown");
  dropdown.onclick = function () {
    dropdown.classList.toggle("active");
  };

  // burgers 

  $(".registration__man__btn").on("click", function (e) {
    e.preventDefault();
    $(".registration__man").toggleClass("active");
    $(".registration__btns").toggleClass("active");
  });
  $(".header__hamburger").on("click", function (e) {
    e.preventDefault();
    $(".header__hamburger").toggleClass("active");
    $(".header__lists").toggleClass("active");
  });
  var header = document.querySelector(".header");
  var toggleClass = "is-sticky";
  window.addEventListener("scroll", function () {
    var currentScroll = window.pageYOffset;
    if (currentScroll > 150) {
      header.classList.add(toggleClass);
    } else {
      header.classList.remove(toggleClass);
    }
  });
});

